window.bookSummaryJSON = "<p><b>\"A gorgeous, aching love letter to stories, storytellers and the doors they lead us through...absolutely enchanting.\" (Christina Henry, best-selling author of </b><b><i>Alice </i></b><b>and </b><b><i>Lost Boys</i></b><b>)</b></p> <p><b><i>Los Angeles Times</i></b><b> best seller!</b></p> <p>In the early 1900s, a young woman embarks on a fantastical journey of self-discovery after finding a mysterious book in this captivating and lyrical debut.&nbsp;</p> <p>In a sprawling mansion filled with peculiar treasures, January Scaller is a curiosity herself. As the ward of the wealthy Mr. Locke, she feels little different from the artifacts that decorate the halls: carefully maintained, largely ignored, and utterly out of place.</p> <p>Then she finds a strange book. A book that carries the scent of other worlds and tells a tale of secret doors, of love, adventure, and danger. Each page turn reveals impossible truths about the world, and January discovers a story increasingly entwined with her own.&nbsp;</p> <p>Lush and richly imagined, a tale of impossible journeys, unforgettable love, and the enduring power of stories awaits in Alix E. Harrow's spellbinding debut - step inside and discover its magic.&nbsp;</p>"; 
